	public static boolean ekkel(int n) {
		int asd = 100;
		String string = ""+n;
		if (string.charAt(string.length()-1) == '9')
			return false;
		if (string.length() != 4)
			return false;
		asd-=string.charAt(0)-'0';
		return n%1000 >= 900+asd-1;
	}
	
	public static boolean legal(long n) {
		String tall = ""+n;
		for (int i = 3; i <= 9; i++) {
			if (tall.contains(""+i))
				return false;
		}
		return true;
	}
